 UPDATE factura_venta SET f_estado = 'Cerrada',f_cob_efectivo = efectivo , f_conv_cod = conv ,f_monto_conv = monto_conv, f_moneda = moneda, f_voucher = voucher,f_tipo = tipo,f_hora = current_time  WHERE f_nro = factura; 

